import React from "react";
import Button from "react-bootstrap/Button";

export default function SinglePost(props) {
  return (
    <tr>
      <td>{props.post.userId}</td>
      <td>{props.post.id}</td>
      <td>{props.post.title}</td>
      <td>
        <div>
          <Button
            variant="info"
            className="mr-3"
            onClick={() => props.handleDetails(props.post.id)}
          >
            Details
          </Button>
          <Button
            variant="danger"
            onClick={() => props.handleDelete(props.post.id)}
          >
            {props.post.isLoadingDelete ? "Loading" : "Delete"}
          </Button>
        </div>
      </td>
    </tr>
  );
}
